import { Node, LinkedList } from '../LinkedList'

class DoubleNode extends Node {
  constructor(element) {
    super(element) 
    this.previous = null
  }
}

export class DoubleLinkedList extends LinkedList {
  constructor(eqFn) {
    super(eqFn)
    this.tail = undefined
  }
  insert(element,index) {
    // 先判断index的序列,0,最后和中间
    if(index >= 0 && index <= this.count) {
      let node = new DoubleNode(element)
      if(index === 0) {
        if(!this.head) {
          this.head = node
          this.tail = node
        } else {
          node.next = this.head
          this.head.previous = node
          this.head = node
        }
      } else if(index === this.count) {
        let cur = this.head
        while(cur.next) {
          cur = cur.next
        }
        cur.next = node
        node.previous = cur
        this.tail = node
      } else {
        const cur = this.head
        let last
        for(let i = 0; i < index; i++) {
          last = cur
          cur = cur.next
        }
        node.next = cur
        cur.previous = node 
        node.previous = last
        last.next = node
      }
      this.count++
      return true
    }
    return false
  }
  remove(index) {
    if(index >= 0 && index < this.count) {
      let cur = this.head
      if(index === 0) {
        // 说明只有一个元素
        if(this.count === 1) {
          this.head = undefined
          this.tail = undefined
        } else {
          this.head = cur.next
          this.head.previous = undefined
        }
      } else if(index === this.count - 1) { // 删除最后一个元素
        debugger
        const pre = this.tail.previous
        this.tail = pre
        this.tail.next = undefined
      } else { // 删除中间元素
        for(let i = 0; i < index; i++) {
          cur = cur.next          
        }
        const next = cur.next
        const previous = cur.previous
        previous.next = next
        next.previous = previous
      }
      this.count--
    }
    return false
  }
}

